import ReactTable from "react-table";
import classes from './Dashboard.module.css';

const Dashboard = (props) => {

    const data = [{
        name: 'Ayaan',
        age: 26
    }, {
        name: 'Ahana',
        age: 22
    }, {
        name: 'Peter',
        age: 40
    }];

    const columns = [{
        Header: 'Name',
        accessor: 'name'
    }, {
        Header: 'Age',
        accessor: 'age'
    }]
    return (
        <>
            <ReactTable
                data={data}
                columns={columns}
                defaultPageSize={2}
                pageSizeOptions={[2, 4, 6]}
            />
        </>
    );
}

export default Dashboard;
